import React, {Component} from 'react';
import './App.css';
import Person from './Components/Person/Person';

class App extends Component {
  state = {
    applications: [
      {name: "Login system", language: 'c'}
    ]
  }
  render() {
    return (
      <div className="app">
        <h1>Hi, I am React App</h1>
        <p>This is great!!!</p>
        <Person name="max">I am loving it</Person>
        <Person name="Mini">
          <div>
            <h3>I am learning react</h3>
            <p>This is a lesson about props</p>
          </div>
        </Person>
      </div>
    );
  }
}

export default App;
